         <div className="user">
            <img src="https://static.wixstatic.com/media/9d8ed5_b8fcc13f08fc4374bb1f979e032b0eb7~mv2.jpg/v1/fit/w_600,h_567,al_c,q_20,enc_auto/file.jpg" alt="" />
        </div>   
        </div> 
         <div className="menu"></div>
      </div>
    )
}
export default  Single
